        $criteria->where(array(\'id\'=>$id,));
        $resource = $modx->getObject(\'modResource\',$criteria);
        if (empty($resource)) return $output;
    }
    $fieldValue = $resource->get($field);
    if ($fieldValue !== null) {
        $output = $fieldValue;
